//import logo from './logo.svg';
import React,{useState} from 'react';
import SubmitForm from './submitform';
import initialData from './initialData';


function App() {
const[shifts,setShifts]=useState([]);
console.log(shifts)

  return (
    <div className="App">;/
      <header className="App-header">
        {shifts.length}

        {
          shifts.map(shift=>{
            return(
             <div>
               <li>{shift.name}</li> 
               <li>{shift.startTime}</li>
               <li>{shift.endTime}</li> 
             </div>
            )
          })
        }

        <SubmitForm setShifts={setShifts}/>
        <initialData setShifts={setShifts}/>

      </header>
    </div>
  );
}

export default App;
